import React from 'react';

class Stocklevel extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      level: '',
    };
  }

  componentDidMount() {
    console.log(this.props);
    const url = `https://api.nike.com/deliver/available_skus/v1/${this.props.id}`;
    fetch(url)
      .then((res) => res.json)
      .then((json) => {
        const level = json.level;
        console.log(level);
        this.setState({ level: level });
      });
  }

  render() {
    return <p>{this.state.level}</p>;
  }
}

const getSizeLevel = ({ id }) => {
  const url = `https://api.nike.com/deliver/available_skus/v1/${id}`;
  fetch(url)
    .then((res) => res.json)
    .then((json) => {
      const level = json.level;
      return <p>{level}</p>;
    });
};

export default getSizeLevel;
